import React from 'react';
import ReactDOM from 'react-dom';

const Hello = () => {
    return (
        <p>Hello World</p>
    )
}

const App = () => {
const now = new Date()
const a = 10
const b = 20
    return (
        <div>
            <Hello />
            <Hello />
            <p>{a} {b} <br />> {now.toString()} </p>
        </div>
    )
}

ReactDOM.render(<App />, document.getElementById('root'));

